import "./contacts.scss";

const Contacts = ({ isMobile, dataContacts }) => {

  return (
    <div className="page contacts__wrap container">
      <div className="contacts__content">
        <h2 className="typography typography--header">
          <span>| </span>Контакты
        </h2>
        <div className="license__items">
            return (
              <div className="license__item">
                <div className="license__item--left">

                </div>
              </div>
            );
        </div>
      </div>
    </div>
  );
};
export default Contacts;
